export function isValidPhoneNumber(number){
    try {
        return import('./libPhoneNumberMin.js').then(({ isValidNumber, parsePhoneNumber }) => {
            let _validatedNumber = parsePhoneNumber(number, "IN");
            return isValidNumber(_validatedNumber.nationalNumber, _validatedNumber.country);     
        });
    } catch (Exception) {
      return new Promise((res, rej) => {
        window.alert("Something went wrong.");
        res();
      });
    }
}

export function lazyLoadImports(page){
    switch(page){
        case page === ROUTES_DEFINED.admin:
            import('./libPhoneNumberMin.js');
    }
}


